import styles from './Review.module.css'


const Review = () => {
    
    
    
    return(
        <div className={styles.divider}>
        <div className={styles.review}>
            <div className={styles.title}> OUR HAPPY CUSTOMERS</div>

            <div className={styles.review_container}>
                <div>

                </div>

            </div>
            </div>
        </div>
    );
}
export default Review;
